import Header from './Header';
import Inputs from './Inputs';

function Post({
  name,
  email,
  password,
  setName,
  setEmail,
  setPassword,
  handleAddUser,
}) {
  return (
    <div className='App'>
      <Header>API ADD</Header>
      <Inputs
        name={name}
        email={email}
        password={password}
        setName={setName}
        setEmail={setEmail}
        setPassword={setPassword}
      />
    </div>
  );
}

export default Post;
